import React, { useState, useEffect } from "react";
import { logout, getUserData } from "../utils/auth";
import { useNavigate } from "react-router-dom";
import { getFirestore, collection, getDocs } from "firebase/firestore";

function Dashboard() {
  const navigate = useNavigate();
  const [userData, setUserData] = useState(null);
  const [data, setData] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const itemsPerPage = 5;
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const authUser = JSON.parse(localStorage.getItem("user"));
        if (!authUser) {
          navigate("/");
          return;
        }

        const userInfo = await getUserData(authUser.uid);
        setUserData(userInfo);

        if (userInfo.isAdmin) {
          await fetchAllClients(); // Admins veem todos os clientes
        } else {
          setData([{ id: 1, name: userInfo.name, ativo: true }]); // Usuário comum vê apenas o próprio perfil
        }
      } catch (error) {
        console.error("Erro ao carregar dados:", error);
        navigate("/");
      } finally {
        setLoading(false);
      }
    };

    fetchUserData();
  }, [navigate]);

  const fetchAllClients = async () => {
    const db = getFirestore();
    const querySnapshot = await getDocs(collection(db, "users"));
    const clients = querySnapshot.docs.map((doc) => ({
      id: doc.id,
      ...doc.data(),
    }));
    setData(clients);
  };

  const handlePageChange = (newPage) => {
    if (newPage > 0 && newPage <= totalPages) {
      setCurrentPage(newPage);
    }
  };

  const handleLogout = async () => {
    await logout();
    navigate("/");
  };

  const totalPages = Math.ceil(data.length / itemsPerPage);
  const startIndex = (currentPage - 1) * itemsPerPage;
  const endIndex = startIndex + itemsPerPage;
  const currentItems = data.slice(startIndex, endIndex);

  if (loading) {
    return <p>Carregando...</p>;
  }

  return (
    <div className="dashboard-container">
      <h1>{userData.isAdmin ? "Admin Dashboard" : "Meu Perfil"}</h1>
      {userData.isAdmin && (
        <button onClick={() => navigate("/manage-users")}>Gerenciar Usuários</button>
      )}
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Nome</th>
            <th>Ativo</th>
            {userData.isAdmin && <th>Ações</th>}
          </tr>
        </thead>
        <tbody>
          {currentItems.map((item) => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>{item.name}</td>
              <td>{item.ativo ? "Sim" : "Não"}</td>
              {userData.isAdmin && (
                <td>
                  <button onClick={() => navigate(`/details/${item.id}`)}>Ver Detalhes</button>
                </td>
              )}
            </tr>
          ))}
        </tbody>
      </table>
      <div className="pagination">
        <button onClick={() => handlePageChange(currentPage - 1)} disabled={currentPage === 1}>
          Anterior
        </button>
        <span>
          Página {currentPage} de {totalPages}
        </span>
        <button onClick={() => handlePageChange(currentPage + 1)} disabled={currentPage === totalPages}>
          Próxima
        </button>
      </div>
      <button onClick={handleLogout} className="logout-button">
        Logout
      </button>
    </div>
  );
}

export default Dashboard;
